rs -->\r\n          <div id="card-errors" role="alert"></div>\r\n        </div>      \r\n        <button class="btn btn-primary">Submit Card Info</button>\r\n    </form>\r\n</div>\r\n<button class="btn btn-primary add-card" (click)="showCreditCardForm=!showCreditCardForm;" *ngIf="!showCreditCardForm">Add Card</button>\r\n'},function(e,t){e.exports='<back-component></back-component>\r\n<div class="appointment-container">\r\n    <div class="calendar" [ngSwitch]="view">        \r\n        <h3>\r\n            <span mwlCalendarPreviousView class="btn previous-button" view="month" [(viewDate)]="viewDate" (click)="previousMonth()">Prev</span>            \r\n            {{ viewDate | calendarDate:\'monthViewTitle\':\'en\' }}\r\n            <span mwlCalendarNextView class="btn next-button" view="month" [(viewDate)]="viewDate" (click)="nextMonth()">Next</span>            \r\n        </h3>\r\n        <mwl-calendar-month-view *ngSwitchCase="\'month\'" (eventClicked)="eventClicked($event)" [viewDate]="viewDate" [refresh]="refresh" [events]="events">\r\n        </mwl-calendar-month-view>\r\n    </div>\r\n    <router-outlet></router-outlet>\r\n</div>\r\n'},function(e,t){e.exports='<back-component></back-component>\r\n<h4>Your Clients</h4>\r\n<div class="clients-list">\r\n    <span *ngIf="!clients || clients.length == 0" class="no-clients">You currently do not have any clients assigned to you.</span>\r\n    <div class="client-item" *ngFor="let client of clients">\r\n        <div class="client-picture">\r\n            <img *ngIf="client.img" src="{{client.img.url}}" alt="client.firstname" />\r\n            <div *ngIf="!client.img" class="no-picture" ></div>\r\n        </div>\r\n        <div class="client-info">\r\n            <!-- TODO: Rotue to client -->\r\n            <span class="client-name" *ngIf="client.firstname" >{{client.firstname}} {{client.lastname}}</span>\r\n            <span class="client-name" *ngIf="!client.firstname">No Name</span>\r\n            <a class="client-e